import React from 'react';
import './Search.css';


//Make class based
const Search = () => {
   return(
      <form className="SearchForm">
         <input type="text" className="textbox" placeholder="Search"/>
            <input title="Search"  type="submit" className="class="glyphicon glyphicon glyphicon-search/>
      </form>
)
};


export default Search;
